INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4de13cea322841aa8ad68dd4d03a63e2', '20f5693ca80c4c74a422a9dfa988e9a6', NULL, NULL, 'Charlie 1981', 8, 0, 0, 0, '', 'An unfiltered strong ale that is amber in color and has an intense piney hop aroma. The beer is named in honor of Charlie Papazian, president of the Association of Brewers, founder of the American Homebrewers Association and homebrewing guru. John Maier, Brewmaster for Rogue Ales, made his first batch of beer in 1981 using Papazians influential book \"The New Complete Joy of Homebrewing.\" \r\nBrewed with Munich and Crystal 40 two-row pale malt, and dry-hopped with Horizon, Sterling and Amarillo hops, free range coastal waters, and top fermenting Pacman yeast.');
