INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('42ac1dca60e94ce0a5a6a7f9edf09764', '2a58f7cedbe94fd9830ddb857dea9157', NULL, NULL, 'Alaskan Summer Ale', 5, 0, 0, 0, '', 'Based on the traditional style of KÃ¶lsch beer brewed in Cologne, Germany.\r\n\r\nAlaskan Summer Ale balances a softly malted palate with the clean freshness of Hallertauer hops. In the tradition of the style, neither overpowers the other. Both hops and malt come together to refresh and renew the palate. The straw-gold color and easy drinkability are an enjoyable way to celebrate summer.\r\n\r\nAlaskan Summer Ale is made from glacier-fed water and a generous blend of European and Pacific Northwest hop varieties and premium two-row and specialty malts. Our water originates in the 1,500 square-mile Juneau Ice Field and from the more than 90 inches of rainfall Juneau receives each year.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('430358f4243449768e5bed1db94380f1', 'b0ea7ae584944dd5a3b806a1de8e5718', NULL, NULL, 'Paracelsus Zwickl', 5, 0, 0, 0, '', 'Paracelsus Zwickl is a natural beer specialty with a mellow impression on the tongue. The aftertaste unfolds a slight bitterness. Zwickl-beer is not filtered and therefore shows some cloudiness due to rests of yeast, minerals and trace elements.\r\n\r\nThis very special beer is brewing at its best using a sophisticated recipe combined with love and dedication. Stiegl only uses excellent ingredients from Austrian agricultural suppliers, applying biological techniques. As a result of this Paracelsus Zwickl beer was awarded the Bio-Austria certificate. Bio-production is subject to strict yearly controls by â€œAustria-Bio-Guarantyâ€.\r\n\r\nâ€œBier is a really divine medicineâ€. This quotation comes from Paracelsus (1493 â€“ 1541). He was a well known physician, forward thinker and visionary who lived in Salzburg for many years. He found out that beer had healing powers.');
