INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('46f1fc26543b4bf8885ad53d2832a58d', '8be478aaefc14c988bbd984ecccaf677', NULL, NULL, 'Yuengling Black and Tan', 4, 0, 0, 0, '', 'Yuengling Original Black & Tan is a pioneer brand that models a traditional English Half & Half. Introduced in 1986, Yuengling produced one of the first hand-crafted draft blends to lead this style of American brewing. Black & Tan combines our popular Dark Brewed Porter and Premium Beer to create a brew that is rich and dark in color, with a well balanced flavor that finishes smooth and satisfying. It has a faint sweetness with hints of caramel and coffee from the dark roasted malts. One sip and you''ll appreciate how Yuengling raised the bar with our Original Black & Tan.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('471b5037dce54a05b3dbe2ec7b8d090f', '14c8467940ec42e0a43d7a67e0375731', NULL, NULL, 'Phoenix', 5, 0, 0, 0, '', 'A polished, golden yellow beer with 5% alcohol. Phoenix beer is pasteurised after bottling, according to natural conservation methods. The quality of the underground water also allows us to produce a beer with no chemicals additives. Time of maturation before distribution is meticulously controlled.');
