INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3b3e2106e3a74b13aa720853fe464b06', '7ad8825aff794387ace4aa354ef49b64', NULL, NULL, 'Saint Arnold Texas Weat', 3, 0, 0, 0, '', 'A refreshing, flavorful filtered wheat beer. The perfect beer to accompany a meal or for a summer''s day. The wheat contributes a lighter flavor while maintaining a rich body. The beer has a light hop profile -- just enough to give the beer balance and complexity. The light fruitiness is derived from a KÃ¶lsch yeast strain. A chill haze may be present, which is a characteristic of wheat beers. \r\n\r\nSaint Arnold Texas Wheat is best consumed at 40-45Â° Fahrenheit.');
