INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('285685613ef5459a830509c6ac92602d', '6373fec6e4d84db5ae7c64f6230502ce', NULL, NULL, 'Midnight Sun Kolsch', 5, 0, 0, 0, '', 'From the talented brewers of Midnight Sun comes an incredible, beautifully bright and sunny golden ale. Every sip entices the taste buds with a bold balance of pils malt and noble hops. Midnight Sun Kolsch is a traditional German-style beer that unites the liveliness of an ale with the crispness of a lager for real refreshment any time of year. \r\n\r\nCreating a beer that truly serves both newcomers to craft beer as well as avid beer aficionados is no easy task. Midnight Sun Kolsch brewers struck gold with this beer...and now you can too. \r\n\r\nAvailability:\r\nAK - draft (year-round)');
