INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('21431add1d6f456b8a94cbc3ff7f24c1', '924f4d2594fe47a0a732a9e14bc24ad6', NULL, NULL, 'Beewolf Braggot', 7, 0, 0, 0, '', 'This is a hybrid of ale and mead made with 51% malted barley (Pale and Munich malted barley) and 49% Orange blossom honey, it is lightly hopped, spiced with Hibiscus flowers and fermented with Australian ale yeast.\r\n\r\nOur Milton, DE microbrewery brewer Jon Talkington came up with this beer because of his love of different kinds of meads and his interest in Nordic lore and mythology.  The name Beewolf is the name Beowulf translated, meaning bear.\r\n \r\nColor- light amber.\r\nAroma- Pear like fruitiness, with a clean malt and floral honey nose.\r\nFlavor- sweet malt and honey with a subtle fruitiness and a hint of caramel.\r\nABV 7.0%\r\nIBU''s 25\r\n\r\nDue to the limited availability of Beewolf Braggot, we are sorry that we are not able to offer growlers to go.');
