INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0f25ce873b91429aa6ef54bf652562c2', 'c3f06ce635ee4eefbc33e6c206a31f44', NULL, NULL, 'Union Barrel Works Kolsch', 0, 0, 0, 0, '', 'A pale golden German ale with subdued, clean-tasting malt flavor and aroma. This is a beer from the \"old\" brewing tradition before lagers become popular. Fermented at a lower temperature than normal ales, and followed by several weeks of cold lagering.');
