INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('68cb7047cb50458ab091a1e96215df93', 'bb1b3fb78ea24b45997b54edd80aeb8c', NULL, NULL, 'Dynamo Copper Lager', 5, 0, 0, 0, '', 'If malt and hops are the two poles of brewing, this beer is the gently spinning sweet spot between them. First, youâ€™ll notice the spicy aromas of Perle and Hallertau hops. Then - wipe the foam off the tip of your nose - dive into the toasty flavors of Vienna and Munich malts. Dynamo starts strong and finishes crisp and smooth. The balanced flavors, aromas, and even the coppery-red tones of this beer go great with everything. Fear no pairing. The best time to enjoy Dynamo is when youâ€™re thirsty.\r\n\r\nDynamo Copper Lager goes great with pizza, neighborhood block parties, spring rolls, first dates, football games, whiskey, tapas, the Sunday newspaper, late-night burritos, veggie omelets, business lunches, grilled mushrooms, pretzels, political debate, corn-on-the-cob, classic sci-fi flicks, mixed greens, campfires, salmon, billiards, cherry pie, rock shows, pumpernickel, salsa, grand openings, peanuts, sewing bees, extra sharp cheddar cheese, and holidays.');
