INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('6d3ea499cd90434cb9227b89868b164a', '06f1c8a9bb74470981730c2969378ee8', NULL, NULL, 'Stone 12 Anniversery Bitter Chocolate Oatmeal Stout', 9, 0, 0, 0, '', 'Our Anniversary Ale this year stems from 2 pilot beers that were brewed by members of Team Stone. The first was Jeremy Moynierâ€™s incredibly delicious Oatmeal Stout, and the second was Jake Ratzkeâ€™s amazing homebrewed Imperial Stout that had authentic Oaxacan chocolate added to the boil. We loved both beers so much that we decided to combine the recipes to make this yearâ€™s Anniversary offering: Stone 12th Anniversary Bitter Chocolate Oatmeal Stout. This beer pours deep black with a rich brown head of foam. The aroma is dominated by roast malt and cocoa. Upon tasting, the cocoa (we used unsweetened, unprocessed cacao sourced through our friends at Chuao Chocolatier) really comes through with a deep chocolate flavor and a long lasting bitter finish. The roasted grains used add coffee and licorice accents. It is a thick beer, but not sweet, with the addition of oatmeal in the mash providing a rich, silky mouthfeel that adds to the creamy texture.');
