INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8fc99eef44f6473fa440f25d1588dda6', '94b2e7e841504f858034cf078e80a792', NULL, NULL, 'Krampus Imperial Helles Lager', 9, 0, 0, 0, '', 'St. Nicholas, aka Santa Claus, is a magical figure, the bringer of gifts and an icon of holiday spirit. Forgotten by most is his evil side kick and enforcer of â€˜the listâ€™. European tradition says while St. Nick is busy delivering presents to good little boys and girls, Krampus hands out punishments to the bad. A fanged, goat-horned bully, the Christmas Devil uses sticks and chains to beat the naughty children. Dark malts and aromatic hops create the diabolical spirit of this brew. It is finished with lager yeast and aged cold for no less than 30 days. This Imperial Helles Lager will warm even the darkest hearts. \r\n\r\nThis season, replace the cookies with a bottle of Krampus. If he happens to pay a visit, toast to him with this devilish brew. Merry Kramp-mas to all, and to all a good pint!\r\n9.0% abv. â€¢ 20Âº plato â€¢ Imperial Helles Lager â€¢ 22 oz / 1/6 keg');
