INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9b46d69db93d47579e51dd7cad15f136', '894593f13916499cb1c6f6f3a5fb3e69', NULL, NULL, 'OVL Stout', 4, 0, 0, 0, '', 'This nitrogenated dry stout is low in alcohol but big in flavor. Its smooth roasted coffee like aromas and flavor are clean and drinkable.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9b9d8a47d07e4fa1bf837339095be722', '20f5693ca80c4c74a422a9dfa988e9a6', NULL, NULL, 'Dad''s Little Helper', 0, 0, 0, 0, '', '\"This aint your Dads malt liquor\" - Brewmaster John Maier \r\nAfter the death of his wife, Henry Jackson Smart was left to raise 6 young children alone. His courage, love, selflessness and dedication inspired his daughter, Sonora Smart Dodd, to organize the First Fathers Day on June 19th, 1910. In 1924 President Calvin Coolidge proclaimed the third Sunday in June as Fathers Day. President Nixon, in 1972, established it as a permanent day of national observance. \r\nDads is brewed with Harrington and Klages malts, Flaked Corn, Crystal Hops, Free Range Coastal Water, and Czech Pils Yeast. Available in the spring of 2005 in the classic 22-ounce Rogue micropiece.');
