INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a4efc605dda3465cbf2faf9789c40344', 'bef9879a815742129bf0170786802743', NULL, NULL, 'Garde Dog', 5, 0, 0, 0, '', 'Proving the French may actually know something we don''t... Garde Dog is a traditional French Biere de Garde or \"beer for keeping\". This classic farmhouse ale was brewed in March for drinking during the spring and summer months. With it''s toasted aroma and spicy, malty sweetness Garde Dog will liberate you from the winter doldrum.');
