INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a7c34c47e3ed4ed8a004457c33272e15', 'db8e7ee035e44b05911a313f001f3ae0', NULL, NULL, 'Red Tulip', 0, 0, 0, 0, '', 'A red ale with rich and smooth flavors of malted barley, balanced by underlying hints of dark fruit. Brewed in homage to our hometown tulip festival, Red Tulip evokes springâ€™s renewing spirit. Excellent with roasted pork, red-meats and dried fruit.');
