INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aa0e3b6ec2aa4240983f8d3096bc569b', 'ea0c6c70dd6a47d9879315675a4bb02b', NULL, NULL, 'Bar Harbor Real Ale', 5, 0, 0, 0, '', 'A good, clean nutbrown ale with a malty body. This is our most popular ale due to its smooth and malty flavor.\r\n\r\nWe use a mixture of pale, crystal and black malts in this one, and our primary hop is Target, though we also add some Whitbread Goldings Variation as well.\r\n\r\nThe Real Ale is best fresh, so fresh in fact, that it''s great right out of the bright tank.');
