INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ab2b42da5c45428b86b8ea5a3ed49240', 'c0f3c4bc6d374a578874bfd84803ebc3', NULL, NULL, 'Brooklyn Lager', 5, 0, 0, 0, '', 'Brooklyn Lager, the Brewery''s flagship label, is New York''s \"hometown\" beer, brewed to a pre-Prohibition recipe that dates back to the days when Brooklyn was the brewing capital of the East Coast. Brooklyn Lager has won numerous awards. Wrote Michael Jackson in the Simon & Schuster Pocket Guide to Beer: \"The dry-hopped, fresh, flowery, firm, flavourful, Brooklyn Lager **-*** started well, in 1988, and has gained in character since.\"');
