INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ae0d1e8251c649e380f27131c3bce415', '6c7ee6a97d974d23b4033858ffa948ad', NULL, NULL, 'Yellowtail Pale Ale', 4, 0, 0, 0, '', 'So where can you taste a Kolsch? There are no Kolsches being imported into the United States. So you could fly to Cologne. A better idea is to come to Ballast Point Brewing Company and try our Yellowtail Pale Ale Kolsch. We make it with 5% Wheat, finish hop it with Liberty and Tettnanger hops, and ferment it with a yeast we borrowed from a brewery in Cologne. So come on in and enjoy a taste of the Rhineland!!');
