INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b0f2fd40465a4679b663d21da81d7fec', '3be6b00a760647c7ba5d5de8c1bee825', NULL, NULL, 'Cascade Sang Royal', 8, 0, 0, 0, '', 'This Northwest style sour red is a bottled version of our popular Mouton Rouge. This blend of barrels, with up to 16 months of oak barrel lactic fermentation and oak barrel aging, features dark fruit, sour, oak and funk flavors that sweep over your taste buds like an incoming tide.');
