INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b84f3c65002c4ec0bf76d7bbc4433338', '6373fec6e4d84db5ae7c64f6230502ce', NULL, NULL, 'Specialty Beer: Black Double IPA', 8, 0, 0, 0, '', 'To commemorate the 30th anniversary of Specialty Imports'' specialty wine and beer import business, Midnight Sun Brewing Company brewed a very special beer--a black double IPA--to honor this Alaska company''s long-term success. \r\n\r\nThis black double IPA celebrates Specialty Imports'' success in importing and distributing the world''s best wines and beers to the appreciative folks in Alaska. This \"Specialty Beer\" brings together smooth, dark malts with intense aromatic hops to create a wonderfully balanced yet committed-to-flavor ale.\r\n\r\nAvailability: \r\nAK - 22-oz bottles (limited release begins 01/16/2009)\r\n\r\n** An oak-aged version will be released in Fall 2009.');
