INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b975d2921891482d87f6de4e5c76d3f3', '94b2e7e841504f858034cf078e80a792', NULL, NULL, 'Iniquity Imperial Black Ale', 9, 0, 0, 0, '', 'The hexagram talisman has been used around the world for centuries to invoke magic and good luck. The sixâ€“point star is also the customary symbol of the brewer, representing the essential aspects of purity: water, hops, grain, malt, yeast, and of course, the brewer. Wishes of good fortune often collaborate with the brewerâ€™s creativity to yield dramatic results. We carefully chose the name for this Imperial India Black Ale, Iniquity â€“ a word opposing goodness. Why? This beer is contrary to what one may expect from an IPA; this is an ale as black as night. It is the antithesis of Unearthly. Some may consider it an immoral act to blacken an ale. We suggest they donâ€™t rely on conventional standards. Allow the darkness to consume you. Cheers!');
