INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c9cc95d9185f46849cae6b56354a33f8', '6373fec6e4d84db5ae7c64f6230502ce', NULL, NULL, 'Brewtality Espresso Black Bier', 9, 0, 0, 0, '', 'Assistant Brewer Jeremiah works  primarily at Midnight Sun Brewing Company with regular hours at the AK Rock Gym and the occasional shift or two Kaladi Brothers Coffee. To keep up with his weekly work schedule, he enjoys locally roasted coffee in the morning--OK, sometimes in the afternoon as well--and locally brewed beer in the evening-- OK, sometimes in the morning as well. This beer brings two of his worlds together as an incredible antidote for hibernation.');
