INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cb79a0a5a0a8404aa7ea2ae7c052c964', '59e8ce5ecf654c7ab1d209c8a2331268', NULL, NULL, 'stella', 4, 0, 0, 0, '', 'Stella is the most famous brand of beer in Egypt. It has been manufactured in Egypt since the 19th century and so many Egyptian, and actually many experienced travelers, prefer it to any other kind of beer. One will not find a single bar in Egypt that doesnâ€™t sell Stella or even have the Stella logo on the bar or shop. Stella can even be found in many bars in Europe');
