INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d68d44d9bcb049d0acbb960a7528b3ea', '975a06569d444c38a7c7b3cd9ee4a2b0', NULL, NULL, 'Pride of Milford Special Ale', 7, 0, 0, 0, '', '\"Pride of Milford\" is a very special ale with a tapestry of complex flavors and aromas. It is brewed with five malts and fermented with the Ringwood yeast at a higher temperature which gives this beer a uniqueness all its own. \"Pride\" has a distinctive reddish copper color. It is strong and rich beer. When \"Pride\" was first brewed in December 1999, many thought the flavor and aromas of this beer had fruit overtones. No fruit or adjunct flavoring is added to this beer. The unique flavor comes from our special brewing process.');
