INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('da3364d19dbf490a834cc44625f11025', '048f9156b40a469781e7e19d6321d6b5', NULL, NULL, 'Samuel Adams Old Fezziwig Ale', 5, 0, 0, 0, '', 'Spicy and Bold, a big Christmas cookie of a beer.\r\nSamuel Adams® Old Fezziwig® Ale is the Christmas cookie of beer. Bursting with spices of the season and a remarkably full body, it helps those long winter nights pass much quicker. The full body hits the palate first with a depth of malt character ranging from sweeter toffee and caramel notes to the more dark, roasty chocolate notes. Then come the spices in full force. Cinnamon, ginger and orange peel dance on the tongue bringing with them the celebratory spirit that goes hand in hand with the season.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('da9a7eba2681491db274b59c0b5b6e48', 'fbcb4cb6bc974d9295f1f58ac6f7ac00', NULL, NULL, 'Dry Hop Orange', 5, 0, 0, 0, '', 'A conundrum in the world of beer.  This ale does not fit any conventional beer style.  Orange in color only, this beer has hop characteristics of oranges and tangerines.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('da9b881f38be400582de73a8e94ea4e1', 'f06e305fe800484a89cb79619f161a40', NULL, NULL, 'Brune (Brown)', 6, 0, 0, 0, '', 'Dark brown with a nice tan head.\r\nSweet and aromatic.\r\nSmooth and best served cold from a goblet or chalice.\r\n\r\nI have had this on tab, in a 12oz bottle and 1 liter bottle.  It is very common on to be on tap in Belgium and Paris as well as in a bottle in the UK.\r\n\r\nI have not seen it in the US nor can I find a distributor that could get it.');
