INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fcde989e8abc411ca80f57809fd5214d', 'bef3198dea9243d09ed8b09b5f8cdf53', NULL, NULL, 'Colt 45', 6, 0, 0, 0, '', 'For over 4 decades, Colt 45 Premium Malt Liquor has been the \"class of all malt liquor brands\". With its smooth and distinct flavor and historic affiliation with Billy Dee Williams, it has become an urban American icon. If you''re looking for a thick 40, or an ice cold shorty, Colt 45 is the malt liquor that works EVERYTIME!');
